import React, { useState, useEffect } from 'react';
import './App.css';
import axios from 'axios';


/*
npm install axios

npm install react-bootstrap bootstrap
*/

function App() {
  const [bids, setBids] = useState([]);


  const handleSubmit = event => {
    event.preventDefault();
    alert('You have submitted the form.')
  }

  useEffect(() => {
    axios.get('http://127.0.0.1:5000/getBids')
      .then(response => {
        console.log("response: ", response.data);
        console.log("elem: ", response.data[0].Price);
        setBids(response.data);
      })
      .catch(error => {
        console.error(error);
      });
  }, []);

  return (
    <div>

    <div>

    <button onClick={handleSubmit}>change title</button>

    </div>

    <div class="container">
    <table>
      <tr>
        <th>Bidder</th> <th>Price</th>
      </tr>
      {bids.map(bid => (
        <tr>
          <th>{bid.Name}</th> <th>{bid.Price}</th>
        </tr>

      ))}
    </table>
    </div>

    </div>
  );
}

export default App;
